text:
 @크크  호칭이나 명함에는 neurosurgeon 같은 명칭 많이 적는데요, 전문의가 아닌 일반의인 경우나 직업란에 기재할 때는 doctor로도 많이 표기합니다 ㅎㅎ
Dentist는 대학 학부시절부터 수련과정이 다르기도 하고요 ㅎㅎ 
이유는 모르지만 dentist와 doctor는 차이가 있다고 생각합니다 😅

 @BITboxing  수면치료하는 치과에서
간호사 1명 두고 일하는 경우 보긴 했었어요 !
극히 드물어요ㅎㅎㅎ

 @인팁  장래가 치대로 가야지 치과가 무서우
면 그걸 정복을 해야지 일뽄의대 기부금 입학도
터졌는데 어중간한 금수저들 일뽄치대로 가라

 @새초롬  그건 모르겠어요 저는 정시로 대학 들어간거라서~
제가 말하지 않았나요? 입결 낮은 대학도 많지만 높은 대학도 많다구요? 연캠 가천 단대 을지 등등 입결 높은 학과도 많은데 왜 그렇게 단정짓냐는 말이 였어요~ 
입결 높은 대학도 있듯이 낮은 대학도 있는 건 모든 과 공통 사항 아닌가요? 꼭 치과위생사가 아니더라도 다른 직업 가지신 분들께도 그런 말은 실례인 것 같네요

 @딸기좋아  충분히 갈 수 있죵 ~~ 근데 그건 모든 과 공통 사항 아니냐는 말이예요 ㅎㅎ 의대교대 이런 특수 과 제외하고 간호학과 기계공학과 등등 모든 과가 지방대는 5-6등급 맞아도 갑니다
굳이굳이 치과위생사분들 후려치면서 말씀하시는 의도는 ?
못배우신 분 같네요

 @Y T  신경치료를 받기 전에 통증이 심한 경우가 많답니다. 의외로 신경치료를 받으면 통증이 가벼워지기도 해요. 
물론… 치료 받으실때의 통증은 있으시겠죠 ^^;;
좋은 하루 되세요 !
